description:
The Cornelia Tuttle Hamilton Noro Book 5 Wanderlust issued Fall 2007 contains 16 knitting projects for Noro Silk Garden, Silk Garden Lite, Silk Garden Chunky, Niji,  Cashmere Island, Cash Iroha, Kureyon, Silk Mountain, Iro and Kochoran yarns.
